import React, { Component } from 'react';
import css from './index.module.scss'
import Axios from '_axios@0.19.0@axios';
import axios from 'axios'
//import Swiper from 'swiper'
class Homebroadcast extends Component {
    state = {
        datalist:[]
    }
    componentDidMount() {
        axios.get('https://api9.wochu.cn/api/app/acts?version=20.0.0&source=H').then(
            res => {
                console.log(res.data.data.acts[0]);

            }
        )
    }
    render() {
        //console.log(this.props.info);

        return (            
           < div className = "swiper-container"
           id = {
                   css.Homeswiper
               } >
               <
               div className = "swiper-wrapper"
           id = {
                   css.swiperwrapper
               } > {
                   this.state.datelist.map((item, index) => {
                           return ( <
                               div className = "swiper-slide"
                               id = {
                                   css.swiperslide
                               }
                               key = {
                                   index
                               } >
                               <
                               img src = {
                                   item.picUrl
                               }
                               alt = {
                                   item.title
                               }
                               />  <
                               /div>    
                           )
                       }

                   )
               } <
               /div> {
                   /* 如果需要分页 */ } <
               div className = 'swiper-pagination' > < /div> <
               /div>
        )       
    }
}



export default Homebroadcast
